const fs = require('fs');
const db = require('diskdb');

if (!fs.existsSync('./data')) fs.mkdirSync('./data');

const collection = async (collection) => {

  return await db.connect('./data/db', [collection]);
}

module.exports.collection = collection;

const toClass = function(obj, proto) {
  obj.__proto__ = proto;
    return obj;
}

module.exports.toClass = toClass;

const _ = require('lodash')
const Action = require('proxy/actions').Action;
const toClass = require('./helper').toClass
const db = require('./connect');

const getPushes = (query={authorised: false}) => {
  const data = db.collection('pushes').find(query);
  return _.chain(data)
    .map((x) => toClass(x, Action.prototype))
    .value();  
}

const getPush = (id) => {
  const data = db.collection('pushes').findOne({id: id});
  const action = toClass(data, Action.prototype);
  return action;    
}

const writeAudit = (action) => {    
  if (action.method !== 'POST') {
    return;
  }

  var options = { multi: false, upsert: false };  
  db.collection('pushes').update({id: action.id}, action, options);
}

const authorise = (id) => {
  console.log(`data::authorizing ${id}`)
  const action = getPush(id);
  action.authorised = true;
  writeAudit(action);
  return { message: `authorised ${id}`};
}

module.exports.getPushes = getPushes;
module.exports.writeAudit = writeAudit;
module.exports.getPush = getPush;
module.exports.authorise = authorise;
